import React, { useState } from "react";
import {
  authorize,
  getCredentials,
  loadItems,
} from "../integrations/hubspot"; // adjust path if needed

export default function HubSpotIntegration() {
  const [userId, setUserId] = useState("TestUser");
  const [orgId, setOrgId] = useState("TestOrg");
  const [loadedData, setLoadedData] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const handleAuthorize = async () => {
    try {
      await authorize(userId, orgId);
    } catch (err) {
      setError("Authorization failed.");
    }
  };

  const handleGetCredentials = async () => {
    try {
      const creds = await getCredentials(userId, orgId);
      console.log("Credentials:", creds);
      alert("Credentials retrieved. Now click 'LOAD DATA'");
    } catch (err) {
      setError("Failed to get credentials.");
    }
  };

  const handleLoadData = async () => {
    try {
      setLoading(true);
      setError("");
      const creds = await getCredentials(userId, orgId);
      const items = await loadItems(creds);
      setLoadedData(items);
    } catch (err) {
      setError("Failed to load HubSpot data.");
    } finally {
      setLoading(false);
    }
  };

  const handleClear = () => {
    setLoadedData([]);
    setError("");
  };

  return (
    <div style={{ padding: "20px", maxWidth: "600px", margin: "auto" }}>
      <h2>HubSpot Integration</h2>

      <label>User:</label>
      <input
        type="text"
        value={userId}
        onChange={(e) => setUserId(e.target.value)}
        style={{ width: "100%", marginBottom: "10px" }}
      />

      <label>Organization:</label>
      <input
        type="text"
        value={orgId}
        onChange={(e) => setOrgId(e.target.value)}
        style={{ width: "100%", marginBottom: "10px" }}
      />

      <div style={{ display: "flex", gap: "10px", marginBottom: "10px" }}>
        <button onClick={handleAuthorize}>AUTHORIZE HUBSPOT</button>
        <button onClick={handleGetCredentials}>GET CREDENTIALS</button>
      </div>

      <div style={{ display: "flex", gap: "10px", marginBottom: "10px" }}>
        <button onClick={handleLoadData}>LOAD DATA</button>
        <button onClick={handleClear}>CLEAR DATA</button>
      </div>

      {loading && <p>Loading data...</p>}
      {error && <p style={{ color: "red" }}>{error}</p>}

      <h4>Loaded Data:</h4>
      {loadedData.length > 0 ? (
        <ul>
          {loadedData.map((item) => (
            <li key={item.id}>
              <strong>{item.name}</strong> <br />
              <a href={item.url} target="_blank" rel="noreferrer">
                {item.url}
              </a>
            </li>
          ))}
        </ul>
      ) : (
        <p>No data loaded.</p>
      )}
    </div>
  );
}
